import React,{useEffect} from 'react';
import PropTypes from 'prop-types';

import { Row, Col, Typography, Spin  } from 'antd';
import TopBar from '../../layout/topbar/Topbar.container';

const { Text } = Typography;

const Employee = ({ isAuthenticated, getEmployeeRecord, isFetched, record }) => {

    useEffect(() => {
        getEmployeeRecord()
    },[getEmployeeRecord])

    console.log('isFetched', isFetched);
    console.log('record', record);

    return (
        <div>
            {isAuthenticated ?
                    !isFetched ?
                        <Spin tip='loading...' style={{marginTop: '50px'}} /> :
                        <div>
                            <TopBar/>
                            <Row style={{marginTop: '50px'}}>
                                <Col span={6}>col-12</Col>
                                <Col span={6}>
                                    <h2>{record && record.record && record.record.name}</h2>
                                    <h2>{record && record.record && record.record.age}</h2>
                                    <h2>{record && record.record && record.record.gender}</h2>
                                    <h2>{record && record.record && record.record.designation}</h2>
                                    <h2>{record && record.record && record.record.email}</h2>
                                    <h2>{record && record.record && record.record.department}</h2>
                                    <h2>{record && record.record && record.record.joinDate.split('T')[0]}</h2>
                                    <h2>{record && record.record && record.record.address}</h2>
                                </Col>
                            </Row>
                        </div>
                : null}
        </div>
    );
};

Employee.defaultProps = {
    isAuthenticated: false,
};

Employee.propTypes = {
    isAuthenticated: PropTypes.bool,
    isFetched: PropTypes.bool.isRequired,
    record: PropTypes.object,
    getEmployeeRecord: PropTypes.func.isRequired,
};

Employee.styles = {};

export default  Employee;
